// =======================
// CART VARIABLES
// =======================
let cart = [];
let totalAmount = 0;

// =======================
// DISPLAY MENU
// =======================
const menuItemsContainer = document.getElementById("menu-items");

function displayMenu(items) {
  menuItemsContainer.innerHTML = "";
  items.forEach((item) => {
    const div = document.createElement("div");
    div.className = "menu-item";
    div.innerHTML = `
            <img src="${item.img}" alt="${item.name}">
            <h3>${item.name}</h3>
            <p>Price: <span>₹${item.price}</span></p>
            <button onclick="addToCart(${item.id})">Add to Cart</button>
        `;
    menuItemsContainer.appendChild(div);
  });
}

// Initially display all menu items
displayMenu(menuData);

// =======================
// FILTER MENU
// =======================
function filterMenu(category) {
  if (category === "all") {
    displayMenu(menuData);
  } else {
    const filtered = menuData.filter((item) => item.category === category);
    displayMenu(filtered);
  }
}

// =======================
// ADD TO CART FUNCTION
// =======================
function addToCart(id) {
  const item = menuData.find((i) => i.id === id);
  cart.push(item);

  // Update cart count
  document.getElementById("cart-count").innerText = cart.length;

  // Update total amount
  totalAmount += item.price;
  document.getElementById("cart-total").innerText = totalAmount;

  alert(`${item.name} added to cart! Total: ₹${totalAmount}`);
}

// =======================
// ORDER FORM
// =======================
document.getElementById("order-form").addEventListener("submit", function (e) {
  e.preventDefault();
  const name = document.getElementById("name").value.trim();
  const phone = document.getElementById("phone").value.trim();
  const totalAmount = document.getElementById("total").value.trim();
  const feedback = document.getElementById("feedback").value.trim();
  const details = document.getElementById("details").value.trim();

  if (name && phone && details) {
    // Show order summary
    let summary = `Thank you ${name}!\nYour order has been received.\nTotal Amount: ₹${totalAmount}\n\nOrder Details:\n${details}`;
    alert(summary);

    // Reset form and cart
    this.reset();
    cart = [];
    totalAmount = 0;
    document.getElementById("cart-count").innerText = 0;
    document.getElementById("cart-total").innerText = 0;
  } else {
    alert("Please fill all the fields!");
  }
});
